import React from 'react';

const Header = () => {
    return ( 
        <div className="App">
            <header className="App-header">
            <img src="" alt="logo" />
            <p>
                Edit <code>src/App.js</code> and save to reload.
            </p>
            <a
                className="App-link"
                href="https://reactjs.org"
                target="_blank"
                rel="noopener noreferrer"
            >
                Learn React
            </a>
            </header>
        </div>
    );
}

export default Header;
